s($,"azU","akQ",()=>A.dY("This project focuses on building a reliable object detection system for autonomous robotics scenarios where color-based ball detection is critical. The model was custom-trained to distinguish between visually similar objects under non-ideal lighting conditions commonly found in competition environments.Beyond training, significant effort was spent on dataset preparation, class balancing, and tuning inference parameters to reduce false positives and improve consistency. The system was integrated into a ROS 2 workflow, publishing detection results as messages consumable by downstream robot logic.The primary challenges involved handling lighting variance, motion blur, and ensuring real-time performance on embedded hardware. This project emphasizes practical deployment considerations rather than purely model accuracy.",A.c(["assets/images/python.png","assets/images/ros2.png","assets/images/opencv.png","assets/images/ultralytics.png"],t.s),"yolov11_ball_detection_system"))
s($,"azV","ac7",()=>A.dY("This project extends beyond standalone object detection into a complete perception pipeline designed for Robocon 2026. \n        The goal is to bridge raw vision outputs with robot decision-making logic in a clean and maintainable ROS 2 architecture. \n        The pipeline includes detection, post-processing, class filtering, and message synchronization to ensure consistent data flow into control \n        and actuation nodes. Emphasis is placed on modular node design, clear topic interfaces, and predictable latency behavior. Ongoing work focuses \n        on robustness, fault handling, and improving integration between perception and motion planning components in a real competition environment.",A.c(["assets/images/python.png","assets/images/ros2.png","assets/images/opencv.png","assets/images/ultralytics.png"],t.s),"robocon_2026_vision_pipeline"))
s($,"azn","aks",()=>A.dY("This project is a ground-station style Android application designed to visualize telemetry and control drones using MAVLink-based communication. \n        The primary focus is on UI architecture and system layout rather than flight control algorithms. The interface is structured to separate telemetry \n        display, control inputs, and system status indicators, allowing for scalable feature expansion. Qt/QML is used to rapidly prototype responsive layouts \n        while maintaining performance on mobile hardware. Current development prioritizes clean UI layering, message handling structure, and preparation for \n        future integration with real drone hardware.",A.c(["assets/images/flutter.png","assets/images/dart.png","assets/images/qt.png","assets/images/cpp.png"],t.s),"drone_controller_app"))
s($,"azo","akt",()=>A.dY("This application was developed to provide real-time control and monitoring of robots through a mobile interface. It communicates with robots using \n        UDP networking and integrates with ROS 2 to exchange commands, telemetry, and sensor data. The app supports bidirectional communication, enabling both \n        command transmission and live feedback. Special attention was given to latency, connection stability, and maintaining responsiveness during continuous \n        data streaming. This project highlights practical challenges in mobile-to-robot communication and the trade-offs involved in real-time networking on \n        Android platforms.",A.c(["assets/images/java.png","assets/images/android.png","assets/images/ros2.png"],t.s),"android_robot_controller_app"))
s($,"azZ","akT",()=>A.dY("This project implements an omnidirectional mobile robot using mecanum wheels to allow movement in any direction without rotation. The focus is on \n        kinematic modeling, velocity control, and translating high-level motion commands into individual wheel velocities. ROS 2 was used to structure the \n        control system into modular nodes, making the system easier to debug and extend. Deployment on Jetson Xavier introduced additional considerations \n        related to performance and hardware constraints. The project serves as a foundation for understanding more advanced drive systems and motion control strategies.",A.c(["assets/images/python.png","assets/images/ros2.png"],t.s),"4_wheel_mecanum_drive_robot"))
s($,"aA_","akU",()=>A.dY("This project implements a swerve-drive robot where each wheel can independently rotate and drive, allowing for highly flexible motion control. \n        Compared to other drive systems, swerve drive introduces greater mechanical and software complexity. The project focuses on coordinated steering control, \n        velocity synchronization, and command translation within a ROS 2 framework. Running on an Orange Pi emphasizes efficient computation and careful resource \n        management. This work represents an advanced step in mobile robotics control and highlights challenges in precision motion systems.",A.c(["assets/images/python.png","assets/images/ros2.png"],t.s),"4_wheel_swerve_drive_robot"))
s($,"azv","aky",()=>A.dY("This IoT project was designed to automate plant care by monitoring environmental conditions such as soil moisture and triggering irrigation when \n        thresholds are met. The system combines embedded sensing with cloud-based data logging. Data is transmitted over HTTP and logged to Google Sheets, \n        enabling simple visualization and long-term monitoring without complex infrastructure. A lightweight UI was built to display system status and historical \n        trends. The project emphasizes reliability, low cost, and ease of deployment in small-scale environments.",A.c(["assets/images/arduino.png","assets/images/c.png","assets/images/cpp.png","assets/images/flet.png"],t.s),"plant_monitoring_auto_watering_system"))
s($,"azw","akz",()=>A.dY("This project focuses on monitoring water quality using embedded sensors connected to an ESP32 running ESP-IDF. Sensor data is periodically uploaded to the cloud \n        for visualization and analysis. ThingSpeak is used as the data platform, enabling integration with MATLAB for signal analysis and trend evaluation. The system \n        highlights embedded data acquisition, communication reliability, and post-processing of sensor data. This project bridges embedded systems with basic data \n        analytics and environmental monitoring use cases.",A.c(["assets/images/esp32.png","assets/images/c.png","assets/images/cpp.png","assets/images/matlab.png"],t.s),"water_contamination_detection_system"))
